    false,nt"url": null,nt"notes": "LiDAR data was collected by Merrick & Company
    from September through December of 2007 for the Florida Division of Emergency Management
    (FDEM). The project area is located in the southeastern part of Florida, in parts
    of the counties surrounding Lake Okeechobee. LiDAR was collected over approximately
    2289 square miles in parts of the following counties: Broward, Glades, Hendry, Highlands,
    Martin, Okeechobee, and Palm Beach. The maximum point spacing is 4 ft in unobscured
    areas. This data set is a classified data set and has a classification for sugar
